import React from 'react'
import { Datum } from '../model';

const jsonData = require('./../data.json')

const MainPage = () => {
   return (
      <div>
         {jsonData.map((review: Datum) => (
            <div key={review.id}>
               <div className='rating'>{review.attributes.rating}</div>
            </div>
         ))}
      </div>
   )
}

export default MainPage;
